import React from "react";
import Navbar from "../components/Navbar";
import RoomCard from "../components/RoomCard";
import HeroSection from "../components/HeroSection";

const HomePage = () => {
  const rooms = [
    { id: 1, title: "Deluxe Room", price: 100, image: "https://source.unsplash.com/featured/?deluxe-hotel-room" },
    { id: 2, title: "Suite Room", price: 150, image: "https://source.unsplash.com/featured/?suite-hotel-room" },
    { id: 3, title: "Standard Room", price: 80, image: "https://source.unsplash.com/featured/?standard-hotel-room" },
    { id: 4, title: "Luxury Room", price: 200, image: "https://source.unsplash.com/featured/?luxury-hotel-room" },
  ];

  return (
    <div className="dark:bg-gray-900 min-h-screen">
      <Navbar />
      <HeroSection />
      <div className="p-6 max-w-6xl mx-auto">
        <h1 className="text-3xl font-bold mb-6 text-gray-900 dark:text-white">Available Rooms</h1>
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
          {rooms.map((room) => (
            <RoomCard key={room.id} room={room} />
          ))}
        </div>
      </div>
    </div>
  );
};

export default HomePage;
